// src/pages/PreciosOftalmologia.js
import React from 'react';

const PreciosOftalmologia = () => {
  const procedimientos = [
    "Consulta Oftalmológica",
    "Examen de la Vista",
    "Cirugía de Cataratas",
    "Cirugía Refractiva",
    "Tratamiento de Glaucoma",
    "Tratamiento de Degeneración Macular",
    "Cirugía Oculoplástica",
    "Reparación de Laceraciones Oculares",
    "Corrección de Ptosis"
  ];

  return (
    <div>
      <h1>Lista de Precios - Oftalmología</h1>
      <table
        style={{
          width: "100%",
          borderCollapse: "collapse",
          marginTop: "20px"
        }}
        border="1"
        cellPadding="10"
      >
        <thead>
          <tr>
            <th>Procedimiento</th>
            <th>Precio (USD)</th>
            <th>Precio (Bs)</th>
          </tr>
        </thead>
        <tbody>
          {procedimientos.map((procedimiento, index) => (
            <tr key={index}>
              <td>{procedimiento}</td>
              <td>{/* Precio en USD (dejar en blanco para completar) */}</td>
              <td>{/* Precio en Bs (dejar en blanco para completar) */}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default PreciosOftalmologia;
